  const [userProfiles,setUserProfile] = userState([]);

  const fetchUserProfiles = () => {
    axios.get("http://localhost:8080/api/v1/user-profile").then(res => {
      console.log(res);
      const data = res.data;

    });
  };
  useEffect(()=> {
    fetchUserProfiles();
  },[]);
  return <h1>Hello</h1>
};

function App() {
  return (
    <div className="App">
      <UserProfiles />
    </div>
  );
}

export default App;
